window.bookSummaryJSON = "<p><b>New Evil. Relentless Vendettas. Deadly Games. Welcome back to the Dark City.</b></p> <p>I returned to the city with one thing on my mind; find my nemesis and finish her. Nothing else mattered. Not the shadowy Organization I worked for. Not the Magic Council and their veiled threats. None of it.</p> <p>Just me and the witch locked into one final dance. </p> <p>But things weren’t exactly going to plan as I discovered a new, sinister threat. One that was trying to pry at the kind of locked doors that should never be opened, as well as driving a conspiracy to turn the entire world on its head. </p> <p>With Halloween just around the corner, the veil was thinning, bringing darker nights and wild magic. And a terrible danger that would fast turn me from hunter to hunted as I raced toward the final round of a deadly end game.</p> <p>A Game of Witches is the third Morgan Rook novel in the Urban Fantasy Thriller ‘The Order of Shadows’ series.</p> <p>If you love supernatural thrillers, hard boiled action and high octane thrills, then you’ll love this new book from Kit Hallows, author of Urban Fantasy books with teeth!</p> <p>The Order of Shadows Series Titles Include<i>: </i></p> <p><i>Dark City The Order of Shadows Book 1 </i><br> <i>Midnight Falls The Order of Shadows Book 2</i><br> <i>A Game of Witches The Order of Shadows Book 3</i><br> <i>Book 4 Coming Soon!</i><br> <i>Book 5 Soon to Follow!</i></p>"; 
